Description:
Job Description Summary
In this role you will be responsible for the evaluation and qualification of suppliers for our MICT site in Uppsala. This involves selection, development and monitoring of new and existing suppliers for both installed-base products and new product introductions, as well as auditing of suppliers and their manufacturing processes. The majority of suppliers are based in Sweden and European countries and there is a local Sourcing team to interact with. The role reports to the Senior Sourcing Staff Manager and offers the possibility to work in a hybrid office/remote work set-up.
Job Description
GE Healthcare is a leading global medical technology and digital solutions innovator with over 100 years of healthcare industry experience and around 50,000 employees globally. We enable clinicians to make faster, more informed decisions through intelligent devices, data analytics, applications and services, supported by our Edison intelligence platform. We operate at the center of an ecosystem working toward precision health - digitizing healthcare, helping drive productivity and improving outcomes for patients, providers, health systems and researchers around the world.
Essential Responsibilities
Assess and evaluate supplier capabilities and capacity to enable an effective supplier selection process;
Improve supplier quality performance for assigned suppliers and parts via implementation of a robust Quality Planning process;
Develop positive relationships and work closely with Category Sourcing and Program Sourcing Leaders to manage and implement supplier/engineering changes and releases, as well as supplier transfers;
Interface with Suppliers, Engineering, Service, Manufacturing and Sourcing to drive quality improvements that minimize the Costs of Quality, specifically related to Field failures and Factory defects;
Lead Root Cause Investigations, and Corrective and Preventive Action (CAPA) activities at assigned suppliers using the methodologies of, and in compliance with, the CAPA process;
Establish and maintain positive relationships with internal and external interfaces (engineering, service, manufacturing, sourcing, supplier quality, suppliers): to influence product design specifications, and to ensure that customer requirements are understood and achieved;
Travel to supplier sites, as required;
Hybrid (part time on-site/part time remote) work arrangement.
Requirements/Qualifications
Bachelor’s Degree in an engineering or technical discipline OR a Bachelor's non-technical degree with relevant experience in manufacturing, engineering or quality assurance, OR an Associate's Degree with significant manufacturing, engineering, or quality assurance experience;
Some experience in manufacturing, design, or quality assurance;
Some experience in problem solving/root-cause analytical skills to lead and influence others to drive change;
Fluent communicator in English and Swedish (both written and verbal), with ability to communicate at all levels of the organization.
Desired Characteristics
Some experience in lean manufacturing processes;
Some experience in a quality role with understanding of QMS implementation and Continuous improvement methodologies;
Familiarity with various engineering areas of technology, such as, but not limited to: Electronics, Composites, Cable & Harness, Fabrication, Machining, High Level Assemblies, or OEM (Process & Design capability).
Our total rewards are designed to unlock your ambition by giving you the boost and flexibility you need to turn your ideas into world-changing realities. Our salary and benefits are everything you’d expect from an organization with global strength and scale, and you’ll be surrounded by career opportunities in a culture that fosters care, collaboration and support.
We expect all employees to live and breathe our behaviors: to act with humility and build trust; lead with transparency; deliver with focus, and drive ownership – always with unyielding integrity.
GE Healthcare is an Equal Opportunity Employer where inclusion matters. Employment decisions are made without regard to race, color, religion, national or ethnic origin, sex, sexual orientation, gender identity or, age, disability, protected veteran status or other characteristics protected by law. We expect all employees to live and breathe our behaviors: to act with humility and build trust; lead with transparency; deliver with focus, and drive ownership – always with unyielding integrity.
#LI-WROS
Additional Information
Relocation Assistance Provided: No

A highly motivated TTS Trade Sales Transactor, working in partnership with Citi Commercial Bank (CCB) to build solution-driven Trade Sales opportunities and act as trusted advisor to understand the needs of our CCB clients headquartered in Nordics & Benelux countries. An ongoing commitment in identifying new revenue streams and flows, support and own RFPs and deepen wallet penetration for revenue realisation. The successful candidate will deliver Trade revenue growth, overseeing Trade sales performance and will be responsible for driving new business initiatives. This is an individual contributor role that is expected to deliver fast sustainable growth with the ability to manage multiple clients and internal demands.
This role will be reporting to the EMEA CCB Trade Sales Head, with a primary responsibility of supporting the Nordics & Benelux coverage relationship managers by providing our clients with client centric trade and working capital solutions that help them achieve their growth ambitions. The successful candidate will possess knowledge of traditional Trade Services, Trade Finance and Working Capital solutions, a proven record in originating & acquiring new business and excellent client relationship skills.
Role Profile

Core Responsibilities:
Proactively working with CCB RMs to drive business growth, owning trade deals from origination to execution. Being a point of contact for trade matters to Nordics & Benelux based clients;
Build a pipeline in partnership with the RM team and Products teams to drive conversion of deals through participation in client pitches. Regular tracking of deal pipeline and review of implementation and revenue realization;
Own and manage the Trade aspect of CCB client relationships end to end including origination, agreement negotiation, Trade Deal Review approval processes, implementation and on-going utilization.
Foster productive working relationships with partner groups across regional/global teams, to build solutions based on clients’ needs. This position will also work closely with CCB client facing teams to get market feedback back to product teams for new product solution;
Provide client-centric Trade solutions, combined with other product solutions that benefit clients’ end-to-end Working Capital cycle and delivers clients’ growth objectives in an efficient manner;
Identify cross-regional client and industry segments with potential Trade opportunities and structure product solutions specific to the client/industry segment;
Actively partner with functional experts such as Legal, Operations & Compliance to ensure deals are implemented seamlessly.
Work with product control functions to ensure that all relevant documentation (e.g. Product Approval Programs / LCAs) and processes are strictly adhered to.
Lead initiatives including events that facilitate Citi Treasury and Trade Solutions in deepening client relationships, strengthen Citi brand as an industry thought leader, etc. Contribute to growing CCB Nordics & Benelux business through strategic thinking and taking on special projects;
Adopt a risk-based approach balancing risk and returns of Trade products to ensure a progressive, sustainable and long-term growth;
Actively contribute to generation of new product/solution/marketing ideas that allow Citi to continue to be at the forefront of market-first solutions;
Help regional leads with special projects and initiatives;
Support big data analytics initiatives;
Work with Treasury and Trade Solutions (TTS) teams across product, sales and implementation to own the execution of the deals won;
Leverage Seibel CRM sales tool.

Skills
Interpersonal and communication skills for effective presentations, pitches and conversions;
Interest in financial services and helping emerging clients grow;
Ability to multitask and prioritise conflicting deliverables both for clients and internally;
Ability to apply sound ethical judgment regarding personal behaviour, conduct and business practices, and escalating, managing and reporting control issues with transparency.
Know where to apply sound ethical judgment regarding personal behaviour, conduct and business practices, and escalating, managing and reporting control issues with transparency;
Ability to quickly identify problems and solutions leveraging cash product propositions, business drivers, policies, customer needs and market trends;
Understanding of full suite of Trade product propositions, business drivers, policies, customer needs and market trends;
Ability to create longer term, trust and advisory-based relationships with the customers in the portfolio;
Demonstrate thought leadership and vision for future planning and growth;
Analytical skills to evaluate various alternative solutions to customer needs;
In-depth knowledge of regulations, market practices and bank operations;
English – Fluent;
Other Languages – Advantageous.

Development Value
This is an ideal opportunity for someone seeking to build a career in Banking by enhancing skills in Trade, Lending, FX, and Cash Management products;
Exposure to all areas of the bank across sales (including management of clients with more complex requirements), operations, risk and controls;
We foster a culture of meritocracy and diversity, we value and demand respect for others and opportunities to develop are widely available to all;
Knowledge expansion and Coaching/Mentoring with Seniors;
We ensure regularity of 1:1 dialogue to monitor and support both management of the client;
portfolio and to identify personal and professional growth opportunities via an Individual Development Plan;
51% of our employees are women, 24% of our Director’s and Managing Directors are women;
2020 Awards from Global Trade Review Leaders in Trade, Treasury Today Adam Smith Awards, Monarch Innovation Awards, Euromoney Trade Finance Survey, Global Finance Awards.

Equal Opportunity
We recognize talent comes from a wealth of experience and ideas beyond just the technical specifications of a role. If you feel like you can make a meaningful impact even if you don’t necessarily check all the listed requirements, please still consider applying. Diversity of experience and skills supplemented with drive are cornerstones to innovation and excellence and we encourage people from all backgrounds to apply to our positions.
Please let us know if you require any accommodations during the interview process and review Accessibility at Citi.
